<template>
  <view class="body">
	  <div class="content">
	  <div class="tianqi" v-show="tianqiData.city">
		  <div class="time">数据发布时间 {{tianqiData.reporttime}}</div>
		  <div class="city">{{tianqiData.city}}<span style="font-size: 50rpx;">{{tianqiData.weather}}</span></div>
		  <div class="wendu">
			  <div class="left">{{tianqiData.temperature}}℃</div>
			  <div  class="right">
				  <span>{{tianqiData.winddirection}}风{{tianqiData.windpower}}级</span>
				  <span>空气湿度 {{tianqiData.humidity}}%</span>
			  </div>
		  </div>
	  </div>
	  <div class="tianqi" v-show="!tianqiData.city">
	  		  <div class="time">数据发布时间 ---- -- -- --:--:--</div>
	  		  <div class="city">--- <span style="font-size: 50rpx;"></span></div>
	  		  <div class="wendu">
	  			  <div class="left">--℃</div>
	  			  <div  class="right">
	  				  <span>----</span>
	  				  <span>空气湿度 --%</span>
	  			  </div>
	  		  </div>
	  </div>
   <view class="center">
      <view @click="next('dog')" class="kuai box">
        <text>文章生成器</text>
      </view>
      <view @click="next('house')" class="kuai box">
        <text>房贷计算器</text>
      </view>
      <view @click="next('poetry')" class="kuai box">
        <text>古诗拼接</text>
      </view>
      <view @click="next('slscq')" class="kuai box">
        <text>申论生成器</text>
      </view>
	  <view @click="next('idcard')" class="kuai box">
	    <text>身份证归属地</text>
	  </view>
      <view class="kuai box">
        <text>敬请期待....</text>
      </view>
    </view>
	</div>
  </view>
</template>

<script>

export default {
  data() {
    return {
      code: "", //临时登录code
      openid: "",
      token: "",
      loading: false,
	  tianqiData:{}
    };
  },
  onLoad() {
    //    this.getToken();
    // this.getOpenId()
    this.getLocation();
	
    uni.showShareMenu({
      menus: ["shareAppMessage", "shareTimeline"],
    }); //可分享
    uni.checkSession({
      success: (res) => {
        console.log("有效期", res);
        uni.getStorage({
          key: "token",
          success: (res) => {
            let time = res.data.time;
            let endTime = Date.now();
            console.log("获取token", res, endTime);
            if (endTime - time > 7000000) {
              // token有效时间俩小时
              this.getToken();
            }
          },
          fail: () => {
            console.log("没有获取到token");
            this.getToken();
          },
        });
        uni.getStorage({
          key: "openid",
          fail: () => {
            console.log("没有获取到openid");
            this.login();
          },
        });
      },
      fail: (err) => {
        console.log("过期", err);
        if (!this.loading) {
          uni.showLoading({
            title: "登录中...",
          });
          this.loading = true;
          this.login();
        }
      },
    });
  },
  methods: {
    getLocation() {
      console.log("定位获取");
      let _this = this;
      uni.getLocation({
        type: "wgs84",
        success: (res) => {
          console.log("当前位置的经度：" + res.longitude);
          console.log("当前位置的纬度：" + res.latitude);
          uniCloud
            .callFunction({
              name: "getLocation",
              data: {
                location: res.longitude + "," + res.latitude,
              },
            })
            .then((res) => {
              console.log("逆地址解析", res);
              let data = res.result.data.regeocode;
              let city = data.addressComponent.adcode;
              _this.city = city;
              _this.getTianqi(city);
            });
        },
      });
    },
    getTianqi(city) {//获取天气
      uniCloud
        .callFunction({
          name: "getTianqi",
          data: {
            city: city || this.city,
          },
        })
        .then((res) => {
          console.log("城市天气", res);
		  let data=res.result.lives[0]
		  this.tianqiData=data
        });
    },
    next(n, page) {
      if (this.loading) return;
      uni.navigateTo({
        url: `/pagesA/${n}/index`,
      });
    },
    getOpenId(code) {
      //获取openid
      uniCloud
        .callFunction({
          name: "getOpenId",
          data: {
            code: code || this.code,
          },
        })
        .then((res) => {
          // console.log('获取openid',res.result);
          let openid = res.result.openid;
          uni.setStorage({
            key: "openid",
            data: {
              openid,
            },
          });
          if (this.loading) {
            this.loading = false;
            uni.hideLoading();
          }
        });
    },
    getToken() {
      //获取token
      if (!this.loading) {
        this.loading = true;
        uni.showLoading({
          title: "登录中...",
        });
      }
      uniCloud
        .callFunction({
          name: "getToken",
        })
        .then((res) => {
          // console.log("获取token", res);
          let access_token = res.result.access_token;
          uni.setStorage({
            key: "token",
            data: {
              token: access_token,
              time: Date.now(),
            },
          });
        });
      if (this.loading) {
        this.loading = false;
        uni.hideLoading();
      }
    },
    login() {
      const _this = this;
      uni.login({
        provider: "weixin", //使用微信登录
        success: (loginRes) => {
          console.log("登录情况", loginRes);
          _this.code = loginRes.code;
          this.getOpenId(loginRes.code);
          this.getToken();
        },
      });
    },
  },
};
</script>

